```latex
\documentclass{article}
\usepackage{tikz}
\usetikzlibrary{shapes, arrows, calc}

\begin{document}

\begin{tikzpicture}[
    vertex/.style={circle, draw, minimum size=1.5cm, fill=white},
    arc/.style={-latex, thick},
    every node/.style={scale=0.8}
]

% Vertices
\node[vertex, label=above:$V_1$] (V1) at (0,0) {$\bullet$\\ $\bullet$};
\node[vertex, label=above:$V_2$] (V2) at (3,0) {$\bullet$\\ $\bullet$};
\node[vertex, label=above:$V_{c-1}$] (Vc-1) at (9,0) {$\bullet$\\ $\bullet$};
\node[vertex, label=above:$V_c$] (Vc) at (12,0) {$\bullet$};

% Arcs
\draw[arc] (V1) -- (V2);
\draw[arc] (V2) -- ++(1.5,0) -- ++(0,-0.7) -- ++(0,-0.3) node[midway, fill=white] {$\cdots$} -- ++(0,0.3) -- ++(1.5,0) -- (Vc-1);
\draw[arc] (Vc-1) -- (Vc);
\draw[arc] (Vc) to[out=-150,in=-30] (V1);

\end{tikzpicture}

\end{document}
```

### Explanation:
- **Vertex Style**: Each partite set is represented as a circle (`vertex` style) containing dots to signify vertices. The size of these circles can be adjusted using `minimum size`.
- **Arcs**: Directed arcs (`arc` style) represent the connections between partite sets. The arcs are drawn using the `-latex` style for arrowheads.
- **Ellipsis**: An ellipsis is added between $V_2$ and $V_{c-1}$ to indicate the continuation of partite sets.
- **Curved Arc**: The arc from $V_c$ back to $V_1$ is drawn using `to[out=-150,in=-30]` to create a curved path.

This code accurately represents the structure and connectivity of the digraph as described.

